import React, { useState } from 'react';
import axiosInstance from '../axios';
import { useNavigate } from 'react-router-dom';
import axios from 'axios'
import {Container, Avatar, Button, CssBaseline, TextField, FormControlLabel, Checkbox, Link, Grid, Typography} from '@mui/material';

export default function Register() {
    const url = 'http://localhost:8000/api/user/create/'
    const navigate = useNavigate();
    const initialFormData = Object.freeze({
        email: '',
        username: '',
        password: '',
    });

    const [formData, updateFormData] = useState(initialFormData);

    const handleChange = (e) => {
        updateFormData({
            ...formData,
            // Trimming any whitespace
            [e.target.name]: e.target.value.trim(),

        });
        console.log(formData)
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        let formDatasend = new FormData();
        formDatasend.append('email', formData.email)
        formDatasend.append('username', formData.username)
        formDatasend.append('password', formData.password)
        console.log(formDatasend)
        axios.post(url, formDatasend,
            {
                method: 'POST',
                headers: {
                    'content-type': 'multipart/form-data',
                },

            })
            .then((res) => {
                navigate('/login');
                console.log(res);
                console.log(res.data);
            });
    };


    return (
        <Container component="main" maxWidth="xs">
            <CssBaseline />
            <div>
                <Avatar ></Avatar>
                <Typography component="h1" variant="h5">
                    Sign up
                </Typography>
                <form  noValidate>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField
                                variant="outlined"
                                required
                                fullWidth
                                id="email"
                                label="Email Address"
                                name="email"
                                autoComplete="email"
                                onChange={handleChange}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                variant="outlined"
                                required
                                fullWidth
                                id="username"
                                label="Username"
                                name="username"
                                autoComplete="username"
                                onChange={handleChange}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                variant="outlined"
                                required
                                fullWidth
                                name="password"
                                label="Password"
                                type="password"
                                id="password"
                                autoComplete="current-password"
                                onChange={handleChange}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <FormControlLabel
                                control={<Checkbox value="allowExtraEmails" color="primary" />}
                                label="I want to receive inspiration, marketing promotions and updates via email."
                            />
                        </Grid>
                    </Grid>
                    <Button
                        type="submit"
                        fullWidth
                        variant="contained"
                        color="primary"
                        onClick={handleSubmit}
                    >
                        Sign Up
                    </Button>
                    <Grid container justify="flex-end">
                        <Grid item>
                            <Link href="#" variant="body2">
                                Already have an account? Sign in
                            </Link>
                        </Grid>
                    </Grid>
                </form>
            </div>
        </Container>

    )
}
